import React from 'react';
import { BrowserRouter as Router,Route, Link } from 'react-router-dom';

import './App.css';
import Home from './pages/home';


class App extends React.Component {

  constructor(props) {
    super(props);
  }

  render(){
    return (
      <Router>
        <Route path='/' exact render={() => <Home />} />
      </Router> 
    );
  }
}

export default App;
